import React, { useEffect, useState } from 'react'
const product = {
    img: "https://assets.myntassets.com/h_1440,q_100,w_1080/v1/assets/images/7579188/2018/11/5/08a7b230-ee8f-46c0-a945-4e835a3c01c01541402833619-United-Colors-of-Benetton-Men-Sweatshirts-1271541402833444-1.jpg",
    name: "maryoul",
    brand: "Puma",
    price: "200"
}

function Content() {
    const [productsLength, setProductsLength] = useState(5)

    const DynamicClothingSection = (props) => {
        return (
            <div id="box">
                <a href="#">
                    <img src={product.img} alt={product.name} />
                    <div id="details">
                        <h3>{product.name}</h3>
                        <h4>{product.brand}</h4>
                        <h2>{product.price} DNT</h2>
                    </div>
                </a>
            </div>)
    }


    return (
        <div>
            <div id="mainContainer">
                <h1> clothing for men and women </h1>
                <div id="containerClothing">
                    {
                        (new Array(productsLength).fill(0)).map((val, index) => (
                            <div id="box">
                                <a href="#">
                                    <img src={product.img} alt={product.name} />
                                    <div id="details">
                                        <h3>{product.name}</h3>
                                        <h4>{product.brand}</h4>
                                        <h2>{product.price} DNT</h2>
                                    </div>
                                </a>
                            </div>)
                        )
                    }
                </div>
                <h1> accessories for men and women </h1>

                <div id="containerAccessories">
                    {
                        (new Array(productsLength).fill(0)).map((val, index) => (
                            <DynamicClothingSection key={index} />
                        ))
                    }
                </div>

            </div>
        </div>
    );
}

export default Content
